class Solution {

    /**
     * @param Integer[][] $grid
     * @param Integer $k
     * @return Integer
     */
    function shortestPath($grid, $k) {
        $m = count($grid);
        $n = count($grid[0]);

        if ($k >= $m + $n - 2) {
            return $m + $n - 2;
        }

        $queue = new SplQueue();
        $queue->enqueue([0, 0, $k, 0]);
        $visited = [];
        $visited[0][0][$k] = true;
        $directions = [[0, 1], [0, -1], [1, 0], [-1, 0]];

        while (!$queue->isEmpty()) {
            [$x, $y, $remainingEliminations, $steps] = $queue->dequeue();

            if ($x == $m - 1 && $y == $n - 1) {
                return $steps;
            }

            foreach ($directions as [$dx, $dy]) {
                $nx = $x + $dx;
                $ny = $y + $dy;

                if ($nx >= 0 && $nx < $m && $ny >= 0 && $ny < $n) {
                    $newEliminations = $remainingEliminations - $grid[$nx][$ny];

                    if ($newEliminations >= 0 && !isset($visited[$nx][$ny][$newEliminations])) {
                        $visited[$nx][$ny][$newEliminations] = true;
                        $queue->enqueue([$nx, $ny, $newEliminations, $steps + 1]);
                    }
                }
            }
        }

        return -1;
    }

}

class Solution {

    /**
     * @param Integer $n
     * @param Integer[] $rollMax
     * @return Integer
     */
    function dieSimulator($n, $rollMax) {
        $mod = 1000000007;
        $dp = array_fill(0, $n + 1, array_fill(0, 6, array_fill(0, 16, 0)));

        for ($j = 0; $j < 6; $j++) {
            $dp[1][$j][1] = 1;
        }

        for ($i = 2; $i <= $n; $i++) {
            for ($j = 0; $j < 6; $j++) {
                for ($p = 0; $p < 6; $p++) {
                    if ($p != $j) {
                        for ($k = 1; $k <= $rollMax[$p]; $k++) {
                            $dp[$i][$j][1] = ($dp[$i][$j][1] + $dp[$i - 1][$p][$k]) % $mod;
                        }
                    } else {
                        for ($k = 1; $k < $rollMax[$j]; $k++) {
                            $dp[$i][$j][$k + 1] = ($dp[$i][$j][$k + 1] + $dp[$i - 1][$j][$k]) % $mod;
                        }
                    }
                }
            }
        }

        $result = 0;
        for ($j = 0; $j < 6; $j++) {
            for ($k = 1; $k <= $rollMax[$j]; $k++) {
                $result = ($result + $dp[$n][$j][$k]) % $mod;
            }
        }

        return $result;
    }
}

